{"title": " \u304a\u96a3\u306e\u5929\u4f7f\u69d8\u306b\u3044\u3064\u306e\u9593\u306b\u304b\u99c4\u76ee\u4eba\u9593\u306b\u3055\u308c\u3066\u3044\u305f\u4ef6", "url": "https://ncode.syosetu.com/n4774dz/4/", "subtitle": "\uff13\uff1a\u5f93\u5144\u306f\u672c\u5fc3\u304c\u898b\u3048\u306a\u3044", "discourse": ["\u2015\u2015\u3068\u8a00\u3046\u7406\u7531\u3067\u3001\u4eca\u5f8c\u306f\u98df\u4e8b\u91cf\u3092\u6e1b\u3089\u3057\u3066\u304f\u3060\u3055\u3044\u3002\u5185\u5bb9\u3082\u3001\u91ce\u83dc\u306a\u3069\u306e\u30d8\u30eb\u30b7\u30fc\u306a\u3082\u306e\u3092\u4e2d\u5fc3\u306b\u2026\u2026\u9593\u98df\u3068\u591c\u98df\u306f\u3001\u4eca\u65e5\u304b\u3089\u3084\u3081\u307e\u3059", "\u4eca\u56de\u306e\u5a5a\u7d04\u7834\u68c4\u304c\u3001\u582a\u3048\u305f\u306e\u3067\u2026\u2026", "\u305d\u3046\u3067\u3057\u305f\u304b\u2026\u2026\u305d\u308c\u306b\u3057\u3066\u3082\u3001\u304a\u5b22\u69d8\u3002\u53e3\u8abf\u307e\u3067\u5909\u308f\u3063\u3066\u3057\u307e\u308f\u308c\u3066", "\u79c1\u306f\u3001\u4eca\u307e\u3067\u306e\u81ea\u5206\u306b\u5225\u308c\u3092\u544a\u3052\u305f\u3044\u306e\u3067\u3059", "\u301c\u3067\u3059\u308f", "\u301c\u3067\u3059\u306e", "\u301c\u3067\u3057\u3066\u3088", "\u305d\u3093\u306a\u3068\u3053\u308d\u3067\u3001\u306a\u306b\u3092\u3084\u3063\u3066\u3044\u308b\u3093\u3060\u3044\uff1f\u30d6\u30ea\u30c8\u30cb\u30fc\uff1f", "\u304a\u5144\u69d8", "\u3053\u3093\u306b\u3061\u306f\u3001\u30ea\u30e5\u30bc\u304a\u5144\u69d8\u3002\u79c1\u306e\u3053\u3068\u306f\u3001\u304a\u69cb\u3044\u306a\u304f\u3002\u75e9\u305b\u308b\u305f\u3081\u306b\u30c0\u30a4\u30a8\u30c3\u30c8\u3092\u3057\u3066\u3044\u308b\u6700\u4e2d\u306a\u306e\u3067", "\u30c0\u30a4\u30a8\u30c3\u30c8!?", "\u306f\u3044\u3002\u5148\u65e5\u3001\u5a5a\u7d04\u7834\u68c4\u3055\u308c\u3066\u6c17\u3065\u3044\u305f\u306e\u3067\u3059\u3002\u79c1\u306f\u3001\u75e9\u305b\u306a\u3051\u308c\u3070\u306a\u3089\u306a\u3044\u3068", "\u30e9\u30f3\u30cb\u30f3\u30b0\u3060\u306a\u3093\u3066\u2026\u2026\u305d\u3093\u306a\u3053\u3